import React, { Component } from 'react';
import { withRouter} from 'react-router-dom';
import Appbar from '../Components/Dashboard/Appbar';

import SearchNote from '../Components/Dashboard/searchNote';
class NoteSearchPage extends Component {
constructor(props){
    super(props)
    this.state={
        searchResult: [],
        commedy : ''
    }
}
item=(words)=>{
    this.setState({
        keyword : words
    })
}
note=(note)=>{
    this.setState({
commedy : note
    })
}
    render() {
        return (
            <div>
                 <Appbar searchable={this.item} ></Appbar>              

                <SearchNote find={this.state.keyword} again={this.state.commedy}/>
            </div>
        )
    }
}
export default withRouter(NoteSearchPage)
